from typing import Dict, List
import networkx as nx


def calculate_modularity(graph, partition: Dict[int, List[Dict[str, int]]],
                         min_size: int = 0) -> float:
    """
    Calculate the modularity of a graph G given a partition of communities, with an optional minimum community size.

    :param graph: The input graph where nodes represent elements and edges
                  represent connections. The graph can be weighted or unweighted.
    :param partition: A dictionary where each key is a community index and
                      each value is a list of dictionaries containing player data.
                      Each player data dictionary includes 'player_id' and 'elo'.
    :param min_size: Minimum number of players in a community to be included in the modularity calculation.
    :return: The modularity score represented as a float, which measures the
             quality of the partition. A higher score means better
             community structure.
    """
    # Calculate the total weight (or number) of edges in the graph.
    m = graph.size(weight='weight')

    # Get the degree (total edge weight) for each node in the graph.
    degrees = dict(graph.degree(weight='weight'))
    modularity = 0.0

    # Loop through each community in the partition.
    for community in partition.values():
        # Only consider communities with at least min_size players.
        if len(community) < min_size:
            continue  # Skip small communities

        for player_u in community:
            u = player_u['player_id']
            if u not in degrees:
                print(f"Node {u} is not found in the graph.")
                continue  # Skip nodes not found in the graph

            for player_v in community:
                v = player_v['player_id']
                if v not in degrees:
                    print(f"Node {v} is not found in the graph.")
                    continue  # Skip nodes not found in the graph

                # Check if there is an edge between u and v
                A_uv = graph[u][v]['weight'] if graph.has_edge(u, v) else 0
                # Calculate modularity contribution from this pair of nodes
                modularity += A_uv - (degrees[u] * degrees[v]) / (2 * m)

    # Normalize the modularity score by dividing by 2*m.
    return modularity / (2 * m)


